description:
迫力の大口径！高品質ステンレス仕様！<br>三点止めでガッチリ取り付け！<br><br><br>●ボリューム感あふれるデザインで、リアビューの迫力とスポーティ感を大幅にUPさせます。<br>●高硬度ステンレス（SUS304）使用で軽量で錆びにくいマフラーカッターです。<br>●インナーメッシュによりスポーティ感を演出します。<br>●特殊ネジ（イモネジ）2本とコの字金具で取りつけるので確実な取り付けが可能です。<br>●特殊ネジ（イモネジ）を使用しているので、違和感のない装着が可能です。<br>●付属工具付きなので取り付けの際、他の工具の用意の必要はありません。<br><br>*純正マフラーの先端部が曲がっているタイプ、真下向きのタイプ、オーバル等の特殊な形状のタイプには取付けできません。<br>*取り付けの可否については画像を参考にしてください。<br><br><br>■仕様<br>製品サイズ：H145mm×W89mm×D89mm<br>純正マフラー外径：33mm～52mm対応<br>メーカー：セイワ<br>品番：K352<style type="text/css">
